import React, { Component } from 'react'

//组件
import LoginFrom from './LoginFrom'
import ReloginFrom from './reloginFrom'

export default class index extends Component {
  render() {
    return (
        <div className='loginWrap'>
            <div className='title'>
                <span>登录</span>
                <span>账号注册</span>
            </div>
            <div className='formBox'>
                <LoginFrom />
                <ReloginFrom />
            </div>
        </div>
    )
  }
}
